The Last Templar (2009)

Canada
Avontuur / Drama
170 minuten (miniserie)

geregisseerd door Paolo Barzman
met Mira Sorvino, Victor Garber en Scott Foley

Tijdens een tentoonstelling van Vaticaanse schatten in New York overvallen drie verklede mannen het gebouw en stelen een mysterieus stuk. De aanwezige archeologe Tess Chaykin ontdekt later dat de dieven dood zijn en samen met FBI-inspecteur Sean Daley gaat ze op onderzoek uit. Ze ontdekt dat zowel de overvallers als het verdwenen stuk een connectie hebben met de legendarische Tempelridders en er volgt een lange reis over diverse continenten.


